/* eslint-disable @typescript-eslint/no-use-before-define */
import * as React from 'react';
import GridList from '@material-ui/core/GridList';
import GridListItem from '@material-ui/core/GridListItem';

function srcset(image, size, rows = 1, cols = 1) {
  return `${image}?w=${size * cols}&h=${size * rows}&fit=crop&auto=format 1x,
  ${image}?w=${size * cols}&h=${size * rows}&fit=crop&auto=format&dpr=2 2x`;
}

export default function About() {
  return (
    <GridList
      sx={{ width: 500, height: 450 }}
      variant="quilted"
      cols={4}
      rowHeight={121}
    >
      {itemData.map((item) => (
        <GridListItem key={item.img} cols={item.cols || 1} rows={item.rows || 1}>
          <img
            srcSet={srcset(item.img, 121, item.rows, item.cols)}
            alt={item.title}
            loading="lazy"
          />
        </GridListItem>
      ))}
    </GridList>
  );
}

const itemData = [
  {
    img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
